.body_ui-kit {
	background: #e5e5e5;

}

.ui-kit {
	background: #fff;
	width: 1440px;
	margin: 40px auto;


	&__logo {
		position: absolute;
		padding: 30px;
	}

	&--gray {
		background: #F4F4F6;
	}
}

.container {
	display: flex;
	justify-content: space-between;
	align-items: flex-start;

}

.colors {
	padding: 140px 0;
}

.colors__ul {
	list-style: none inside none;
	padding-left: 90px;
}

.colors__li {
	position: relative;
	margin: 20px;
	width: 180px;
	height: 70px;
}

.colors .colors__li:before {
	content: "";
	display: block;
	position: absolute;
	left: -110px;
	width: 70px;
	height: 70px;
	border-radius: 6px;
}

.colors h2 {
	padding-top: 8px;
}

.colors__li:nth-child(1):before {
	background-color: $color-ds100;
}

.colors__li:nth-child(2):before {
	background: $color-ds75;
}

.colors__li:nth-child(3):before {
	background: $color-ds50;
}

.colors__li:nth-child(4):before {
	background: $color-ds25;
}

.colors__li:nth-child(5):before {
	background: $color-ds5;
}

.colors__li:nth-child(6):before {
	background: $color-purple;
}

.colors__li:nth-child(7):before {
	background: $color-green;
}

.font {
	padding: 140px 0;
	width: 417px;

	&_h {
		display: flex;
	}

	&_h2 {
		margin-top: 54px;
	}

	&_h3 {
		margin-top: 53px;
	}

	&_body {
		margin-top: 53px;
	}

	&_type {
		margin-right: 30px;
		width: 37px;
		color: $color-ds25;
		text-align: right;
	}

	&_type_h1 {
		font-size: 24px;
	}

	&_type_h2 {
		font-size: 19px;
	}

	&_type_h3 {
		font-size: 12px;
	}

	&_type_body {
		font-size: 14px;
	}

	&_example {
		width: 350px;
	}
}

.form {
	flex-direction: column;
	padding: 140px 0;

	&__row {
		display: flex;
		flex-direction: row;
		justify-content: space-between;
		align-self: stretch;
	}

	&__col {
		display: flex;
		width: 320px;
		flex-wrap: wrap;
		align-content: flex-start;
		justify-content: space-between;
		align-items: flex-start;
	}

	&__h3 {
		margin: 20px 0 0 0;
	}

	&__h3:first-child {
		margin-top: 3px;

	}

	&__h3-masked {
		margin-top: 23px;

	}

	&__p {
		font-size: 12px;
		line-height: 15px;
		margin: 20px 0 0 0;
		text-transform: uppercase;
		color: $color-ds50;
	}

	&__p:nth-child(2) {
		margin: 0;
	}

	&__text-field {
		margin-top: 5px;
		width: 320px;
	}

	&__text-field--hover {
		margin-top: 5px;
		border-color: $color-ds50;
	}

	&__date-two {
		margin-top: 40px;
		width: 150px;
	}

	&__h3-40 {
		margin-top: 40px;
	}

	&__col:nth-child(2) {
		max-width: 265px;
	}

	&__checkbox {
